create or replace TRIGGER TRG01_INSTRUCTOR
BEFORE INSERT ON INSTRUCTOR
FOR EACH ROW
BEGIN
  <<COLUMN_SEQUENCES>>
  BEGIN
    IF INSERTING THEN
      SELECT INSTRUCTOR_SEQ.NEXTVAL INTO :NEW.INSTRUCTOR_ID FROM SYS.DUAL;
    END IF;
  END COLUMN_SEQUENCES;
END;

